import React from "react";
import List from "../components/List";

const Home = ({ notesAll, setNotes }) => (
  <div className="note-app__body">
    <Link to="archive">📥Archive</Link>
    
    <List label="🗒️All Notes"setNotes={setNotes} notes={notesAll} />
  </div>
);

export default Home;
